import React, { Component } from "react";
import LandingPage from "../../components/landingPage";

class Landing extends Component {
  render() {
    return (
      <React.Fragment>
          <div>
        <LandingPage />
        </div>
      </React.Fragment>
    )
  }
}

export default Landing;
